/* LOGIN */
import * as types from "./types";

const initialState = {
  status: {
    valid: false,
    voteContents: "",
  },
};

export default function getMain(state = initialState, action) {
  switch (action.type) {
    case types.GET_MAIN:
      return {
        ...state,
        status: {
          ...state.status,
        },
      };
    case types.GET_MAIN_SUCCESS:
      console.log("getMain_Success");
      return {
        ...state,
        status: {
          ...state.status,
          valid: true,
          voteContents: action.contents,
        },
      };
    case types.GET_MAIN_FAILURE:
      console.log("login_check_failure");
      return {
        ...state,
        status: {
          ...state.status,
          valid: false,
        },
      };
  }
}
